import React, { Component } from 'react';
import VerticalMenu from './menu/vertical-menu';
import { BrowserRouter as Router, Route } from "react-router-dom";
import PositionAbsolute from '../src/page/position-absoulte';
import PositionMore from '../src/page/position-more';
import './App.sass';

class App extends Component {
  render() {
    return (
      <div className="app">
        <Router>
          <VerticalMenu />
          <div className="app__templete">
            <Route path="/more" component={ PositionMore } />
            <Route path="/absolute" component={ PositionAbsolute } />
          </div>
        </Router>
      </div>
    );
  }
}

export default App;
